import Layout from '../components/Layout'

class Program extends React.Component{
    static async getInitialProps({query}){
        // console.log(query)
        return {query}
    }

    constructor(props){
        super(props)
        this.state={
            className : props.url.query.kelas
        }
    }

    componentDidUpdate(){
        console.log(props)
    }

    render(){
        return(
            <Layout activeClass={this.props.url.pathname}>
                <h1>Program Class {this.state.className}</h1>
            </Layout>
        )
    }
} 


export default Program;
